@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix : <http://example.org/atm#> .

:ATM 
 rdf:type owl:Class .

:Card 
 rdf:type owl:Class .

:Notification 
 rdf:type owl:Class .

:cardExpirationDate 
 rdf:type owl:DatatypeProperty ;
 rdfs:domain :Card ;
 rdfs:range xsd:dateTime .

:hasCard 
 rdf:type owl:ObjectProperty ;
 rdfs:domain :ATM ;
 rdfs:range :Card .

:sendsNotification 
 rdf:type owl:ObjectProperty ;
 rdfs:domain :ATM ;
 rdfs:range :Notification .

:clearNotification 
 rdf:type :Notification .

[ rdf:type owl:Class ;
   rdfs:subClassOf :ATM ;
   owl:equivalentClass 
     [ rdf:type owl:Restriction ;
       owl:onProperty :hasCard ;
       owl:someValuesFrom 
         [ rdf:type owl:Restriction ;
           owl:onProperty :cardExpirationDate ;
           owl:someValuesFrom xsd:dateTime ]
     ]
] .

[ rdf:type owl:Class ;
   rdfs:subClassOf :ATM ;
   owl:equivalentClass 
     [ rdf:type owl:Restriction ;
       owl:onProperty :sendsNotification ;
       owl:someValuesFrom :clearNotification
     ]
] .
